let anchorLinks=document.querySelectorAll("a");for(let e=0;e<anchorLinks.length;e+=1)anchorLinks[e].host!==window.location.hostname&&anchorLinks[e].setAttribute("target","_blank");{{function openModal(e,t){document.getElementById(e).classList.add("open"),window.setTimeout(function(){document.getElementById(t).classList.add("fade-in")},50)}function closeModal(e,t){document.getElementById(t).classList.remove("fade-in"),window.setTimeout(function(){document.querySelector(".nav-modal.open").classList.remove("open")},350)}window.addEventListener("load",function(){document.addEventListener("click",e=>{e.target.classList.contains("nav-modal")&&closeModal()})})}{function toggleButton(e,t){document.getElementById(e).classList.add("button-show"),document.getElementById(e).classList.remove("button-hide"),document.getElementById(t).classList.add("button-hide"),document.getElementById(t).classList.remove("button-show")}}let e=document.querySelector("button#mobileNavClose"),t=document.querySelector("button#mobileNavButton");e.onclick=function(){closeModal("navModal","navModalBody"),toggleButton("sidebarMobileButton","mobileNavClose")},t.onclick=function(){openModal("navModal","navModalBody"),toggleButton("mobileNavClose","sidebarMobileButton")}}